        ></input>
      </div>
      <div className="form-group">
        <button className="btn btn-outline-warning">Register</button>
      </div>
    </form>
  );
  return (
    <Layout>
      <div className="col-md-6 offset-md-3">
        <h1>Register</h1>
        <br />
        {registerForm()}
      </div>
    </Layout>
  );
};

export default Register;
